import React from 'react';
import Square from './Square';
import EmptySquare from './EmptySquare'
import { Grid } from '@material-ui/core';
import '../styles.css';

function Board() {
    let emptySquares = []
    for (let i = 0; i < 16; i++) {
        emptySquares.push(i)
    }
    return (
        <div>
            <Grid 
                container
                spacing={1}
                direction="row"
                justify="center"
                alignItems="center"

            >
                {emptySquares.map(square => 
                    <Grid container item xs={3} spacing={0}>
                        <EmptySquare />
                    </Grid>
                )}
            </Grid>
        </div>
    )


}

export default Board;
